/**
 * A child item within an item package.
 */
export interface ItemPackageItem {
    /**
     * The id of the item package item.
     */
    itemId: string;
    /**
     * The title for the item package item.
     */
    title: string;
    /**
     * The sequence in which this item package item should be displayed.
     */
    displaySequence: number;
    /**
     * The quantity of the item package item within the package.
     */
    quantity: number;
    /**
     * The price in dollars of the item package item.
     */
    price: number;
}
